import React, { useState, useEffect } from 'react';
import { officerAPI } from '../../utils/api';
import { toast } from 'react-toastify';

const MyHistory = () => {
  const [history, setHistory] = useState([]);
  const [loading, setLoading] = useState(true);
  
  // ======== 游릭 ADDED 游릭 ========
  // State to track which item is expanded
  const [expandedId, setExpandedId] = useState(null);

  useEffect(() => {
    fetchHistory();
  }, []);

  const fetchHistory = async () => {
    try {
      setLoading(true);
      const response = await officerAPI.getMyHistory();
      if (response.data.success) {
        setHistory(response.data.data.history);
      }
    } catch (error) {
      toast.error('Failed to fetch equipment history');
    } finally {
      setLoading(false);
    }
  };

  // ======== 游릭 ADDED 游릭 ========
  // Toggles the clicked item
  const handleToggle = (id) => {
    setExpandedId(expandedId === id ? null : id);
  };

  if (loading) {
    return (
      <div className="loading-container">
        <div className="spinner"></div>
        <p>Loading your history...</p>
      </div>
    );
  }

  return (
    <div className="my-history">
      <div className="inventory-header">
        <h3>My Equipment Usage History</h3>
        <p>A complete log of all equipment items you have used.</p>
      </div>

      {history.length === 0 ? (
        <div className="no-data">
          <p>You have no equipment usage history on file.</p>
        </div>
      ) : (
        // ======== 游릭 MODIFIED 游릭 ========
        // Replaced <table> with a collapsible list
        <div className="history-list">
          {history.map((entry) => {
            const isExpanded = expandedId === entry._id;
            return (
              <div key={entry.recordId || entry._id} className="history-item">
                <div 
                  className={`history-item-header ${isExpanded ? 'expanded' : ''}`}
                  onClick={() => handleToggle(entry._id)}
                >
                  <span className="history-item-title">
                    {entry.equipmentPoolName} ({entry.itemUniqueId})
                  </span>
                  <span className={`badge badge-${entry.status === 'Completed' ? 'success' : 'warning'}`}>
                    {entry.status}
                  </span>
                </div>
                
                {isExpanded && (
                  <div className="history-item-details">
                    <div className="detail-grid">
                      <div className="detail-item">
                        <strong>Reason:</strong> {entry.purpose}
                      </div>
                      <div className="detail-item">
                        <strong>Condition (Issue):</strong> {entry.conditionAtIssue}
                      </div>
                      <div className="detail-item">
                        <strong>Requested:</strong> {entry.requestDate ? new Date(entry.requestDate).toLocaleString() : 'N/A'}
                      </div>
                      <div className="detail-item">
                        <strong>Approved (Issued):</strong> {new Date(entry.issuedDate).toLocaleString()}
                      </div>
                      <div className="detail-item">
                        <strong>Returned:</strong> {entry.returnedDate ? new Date(entry.returnedDate).toLocaleString() : 'Pending Return'}
                      </div>
                      <div className="detail-item">
                        <strong>Condition (Return):</strong> {entry.conditionAtReturn || 'N/A'}
                      </div>
                    </div>
                  </div>
                )}
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
};

export default MyHistory;
